import React, { Fragment } from "react";
import MainNavbar from "../components/MainNavbar";
import CardComp from "../components/CardComp";
import Footer from "../components/Footer";
import '../css/Index.css';
import { Container } from "react-bootstrap";
import { CardGroup } from "react-bootstrap";

export default function Index() {
    return (
        <Fragment>
            <body>
                <MainNavbar />
                <hr id="hr"></hr>
                <Container id="ContainerMainPage">
                    <CardGroup>
                        <CardComp img="https://bucket-img.tnlmedia.com/cabinet/files/consoles/2/teams/2/2021/9/ykvE14QMdpeEcShwkQr1T5H4IVTHV2dCVsXNCnuG.jpg" />
                        <CardComp img="https://thumbor.forbes.com/thumbor/960x0/https%3A%2F%2Fspecials-images.forbesimg.com%2Fimageserve%2F61116cea2313e8bae55a536a%2F-Dune-%2F0x0.jpg%3Ffit%3Dscale" />
                        <CardComp />
                        <CardComp />
                        <CardComp />
                        <CardComp />
                        <CardComp />
                        <CardComp />
                        <CardComp />
                        <CardComp />
                    </CardGroup>
                </Container>
                <Footer />
            </body>
        </Fragment>
    );
}
